import "./ExpenseFilter.css";

const ExpenseFilter = () => {
  return (
    <div className="expenses-filter">
    <label for="filter">
      Filter by year
      <select name="filter">
        <option value="2022"></option>
        <option className="expenses-filter__control" value="2021"></option>
        <option className="expenses-filter__control" value="2020"></option>
        <option className="expenses-filter__control" value="2019"></option>
      </select>
    </label>
    </div>
  );
};

export default ExpenseFilter;
